import React from "react";
function Social() {
  return (
    <ul className="list-group">
      <li className="list-group-item">
        <input type="checkbox" id="facebook"></input>
        <label for="facebook">Facebook</label>
      </li>
      <li className="list-group-item">
        <input type="checkbox" id="youtube"></input>
        <label htmlForfor="youtube">Youtube</label>
      </li>
      <li className="list-group-item">
        <input type="checkbox" id="instagram"></input>
        <label for="instagram">Instagram</label>
      </li>
    </ul>
  );
}
export default Social;
